<script>
import 'lazysizes'
import { gsap } from 'gsap'
import { mapState, mapMutations } from 'vuex'
export default {
  computed: {
    ...mapState([
      'objectChosen',
      'result'
    ])
  },
  methods: {
    ...mapMutations([
      'updateCurrentSubview'
    ]),
    getStickDetail() {
      this.updateCurrentSubview({ value: 'StickDetail' })
    }
  },
  mounted() {
    const timeline = gsap.timeline()
    const timelineHeader = gsap.timeline({
      onComplete: () => {
        setTimeout(this.getStickDetail, 500)
      }
    })
    const timelineBody = gsap.timeline()

    const tweenWrapper = gsap.from(
      this.$el, 
      { 
        autoAlpha: 0,
        duration: 1
      }
    )

    const tweenRibbon = gsap.from(
      this.$refs.ribbon,
      {
        autoAlpha: 0,
        duration: 1
      }
    )

    const tweenBullLogo = gsap.from(
      this.$refs.bullLogo,
      {
        y: -50,
        autoAlpha: 0,
        duration: .35
      }
    )

    const tweenYear = gsap.from(
      this.$refs.year,
      {
        y: 50,
        autoAlpha: 0,
        duration: .35
      }
    )

    const tweenLampLines = gsap.fromTo(
      [this.$refs.lampLineLeft, this.$refs.lampLineRight],
      {
        yPercent: -50,
        autoAlpha: 0,
      }, {
        yPercent: -25,
        autoAlpha: 1,
        duration: .35,
        // ease: "elastic.out(1.2, 0.75)",
        ease: "power4.out"
      }
    )

    const tweenLampLinesLower = gsap.to(
      [this.$refs.lampLineLeft, this.$refs.lampLineRight],
      {
        yPercent: 0,
        duration: .8,
        ease: "elastic.out(1, 0.75)",
        onComplete: () => {

          gsap.to(
            [this.$refs.lampLineLeft, this.$refs.lampLineRight],
            {
              rotation: 3,
              duration: 1,
              onComplete: () => {
                [this.$refs.lampLineLeft, this.$refs.lampLineRight]
                  .forEach(element => {
                    element.classList.add('stickResult__cell--lampWithLine--swing')
                  })            
              }
            }
          )

          
        },
        
      }
    )

    const tweenLamps = gsap.from(
      [this.$refs.lampLeft, this.$refs.lampRight],
      {
        yPercent: -50,
        ease: "elastic.out(1, 0.75)",
        duration: .80
      }
    )
    const tweenCongratulations = gsap.from(
      this.$refs.congratulations,
      {
        yPercent: -100,
        ease: "circ.out",
        duration : .35,
        autoAlpha: 0
      }
    )

    const durationP1 = .35
    const durationP2 = .35
    const durationP3 = .35
    const durationP4 = .35

    const tweenGlyphBase = gsap.from(
      this.$refs.glyphBase,
      {
        scale: .250,
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenThreeStarsAppear = gsap.from(
      [
        this.$refs.stars[1], 
        this.$refs.stars[2], 
        this.$refs.stars[3]
      ],
      {
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenCloudUpperLeft = gsap.from(
      this.$refs.cloudUppers[0],
      {
        x: 250,
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenCloudUpperRight = gsap.from(
      this.$refs.cloudUppers[1],
      {
        x: -250,
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenCloudLowerLeft = gsap.from(
      this.$refs.cloudLowers[0],
      {
        x: -250,
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenCloudLowerRight = gsap.from(
      this.$refs.cloudLowers[1],
      {
        x: 250,
        autoAlpha: 0,
        duration: durationP1
      }
    )

    const tweenGlyphBaseEnlarge = gsap.to(
      this.$refs.glyphBase,
      {
        scale: 1.25,
        duration: durationP2
      }
    )

    const timelineStarSwap = gsap.timeline()
    const tweenRightUpperStarFadeOut = gsap.to(
      this.$refs.stars[2],
      {
        autoAlpha: 0,
        duration: durationP2
      }
    )
    const tweenUpperLeftStarFadeIn = gsap.from(
      this.$refs.stars[0],
      {
        autoAlpha: 0,
        duration: durationP2
      }
    )
    timelineStarSwap
      .add(tweenRightUpperStarFadeOut)
      .add(tweenUpperLeftStarFadeIn, '<')

    const tweenPanelAppear = gsap.fromTo(
      this.$refs.panel,
      {
        scale: .35,
        
      },
      {
        scale: .8,
        duration: .35
      }
    )

    

    const tweenPanelEnlarge = gsap.to(
      this.$refs.panel,
      {
        scale: 1,
        duration: durationP3
      }
    )

    const tweenGlyphBaseEnlargeAgain = gsap.to(
      this.$refs.glyphBase,
      {
        scale: 1.5,
        duration: durationP3
      }
    )

    const tweenGlyphBaseReset = gsap.to(
      this.$refs.glyphBase,
      {
        scale: 1,
        duration: durationP4
      }
    )

    const tweenCloudUp = gsap.to(
      this.$refs.cloudUppers[0],
      {
        y: -35,
        duration: durationP3,
      }
    )

    const tweenCloudUpReverse = gsap.to(
      this.$refs.cloudUppers[0],
      {
        y: 0,
        duration: durationP4,
      }
    )
    
    const tweenCloudDown = gsap.to(
      this.$refs.cloudUppers[1],
      {
        y: 35,
        duration: durationP3
      }
    )

    const tweenCloudDownReverse = gsap.to(
      this.$refs.cloudUppers[1],
      {
        y: 0,
        duration: durationP4
      }
    )

    const tweenCloudLeft = gsap.to(
      this.$refs.cloudLowers[0],
      {
        x: -25,
        duration: durationP3
      }
    )
    const tweenCloudLeftReverse = gsap.to(
      this.$refs.cloudLowers[0],
      {
        x: 0,
        duration: durationP4
      }
    )
    const tweenCloudRight = gsap.to(
      this.$refs.cloudLowers[1],
      {
        x: 25,
        duration: durationP3
      }
    )
    const tweenCloudRightReverse = gsap.to(
      this.$refs.cloudLowers[1],
      {
        x: 0,
        duration: durationP4
      }
    )

    const tweenLowerLeftStarFadeOut = gsap.to(
      this.$refs.stars[1],
      {
        autoAlpha: 0,
        duration: durationP3
      }
    )

    const tweenLowerLeftStarFadeOutReverse = gsap.to(
      this.$refs.stars[1],
      {
        autoAlpha: 1,
        duration: durationP4
      }
    )

    const tweenUpperRightStarFadeIn = gsap.to(
      this.$refs.stars[2],
      {
        autoAlpha: 1,
        duration: durationP3
      }
    )

    timelineBody
      .add(gsap.set(this.$refs.stars[0], {autoAlpha: 0}))
      .add(tweenGlyphBase)
      .add(tweenThreeStarsAppear, '<')
      .add(tweenCloudUpperLeft, '<')
      .add(tweenCloudUpperRight, '<')
      .add(tweenCloudLowerLeft, '<')
      .add(tweenCloudLowerRight, '<')
      .add(tweenGlyphBaseEnlarge, '>')
      .add(timelineStarSwap, '<')

      .add(gsap.set(this.$refs.panel, {autoAlpha: 1}))
      .add(tweenPanelAppear, '>-.35')
      
      .add(tweenPanelEnlarge)
      .add(tweenGlyphBaseEnlargeAgain, '<')

      .add(tweenCloudUp, '<')
      .add(tweenCloudDown, '<')

      .add(tweenCloudLeft, '<')
      .add(tweenCloudRight, '<')

      .add(tweenLowerLeftStarFadeOut, '<')
      .add(tweenUpperRightStarFadeIn, '<')

      .add(tweenCloudUpReverse)
      .add(tweenCloudDownReverse, '<')
      .add(tweenCloudLeftReverse, '<')
      .add(tweenCloudRightReverse, '<')
      .add(tweenGlyphBaseReset, '<')
      .add(tweenLowerLeftStarFadeOutReverse, '<')

    timelineHeader
      .add(tweenWrapper)
      .add(tweenRibbon, '>-.25')

      .addLabel('begin')
      .add(tweenBullLogo)
      .add(tweenYear, '<')
      .add(tweenLampLines, '<')
      .addLabel('readyToLower')
      .add(tweenLampLinesLower, '>')
      .add(tweenLamps, 'readyToLower')
      .add(tweenCongratulations, '<')

      .add(timelineBody, 'begin')

    timeline
      .add(gsap.set(this.$refs.panel, { autoAlpha: 0 }))
      .add(timelineHeader, '0')
      // .add(gsap.from(
      //   this.$refs.solve,
      //   {
      //     scale: 0,
      //     duration: .50,
      //     scale: 0,
      //     ease: "elastic.out(1, 0.75)"
      //   }
      // ), '>1.5')

    
      

  }
}
</script>
